import React, { Component } from "react";

class UserAddPost extends Component {
  render() {
    return (
      <li class="write-new">
        <form action="#" method="post">
          <textarea
            placeholder="Write your comment here"
            name="comment"
          ></textarea>
          <div>
            <img
              src="images/avatar_user_2.jpg"
              width="35"
              alt="Profile of Bradley Jones"
              title="Bradley Jones"
            />
            <button type="submit">Submit</button>
          </div>
        </form>
      </li>
    );
  }
}

export default UserAddPost;
